import './App.css';
import Header from './components/header';
import CreatePost from './components/createPost';
import {Flex} from '@chakra-ui/react'
import Posts from './components/post';

function App() {
  return (
    <>
      <Header />
      <CreatePost/>
      <Flex
      justifyContent="center"
      alignItems="center"
      flexDirection="column"
      >
        <Posts/>
        <Posts/>
        <Posts/>
      </Flex>
    </>
  );
}

export default App;
